    struct Plan {
        uint256 ethPrice;     // Price in wei
        uint256 usdtPrice;    // Price in USDT (6 decimals)
        uint256 interval;     // Duration in seconds
        string name;          // Plan name
        bool active;          // Is plan active
    }

    struct Subscription {
        uint256 expiresAt;           // Timestamp when subscription expires
        uint256 totalPaidETH;        // Total ETH paid by user
        uint256 totalPaidUSDT;       // Total USDT paid by user
        bool autoRenewEnabled;       // Auto-renewal opt-in status
        PaymentMethod preferredMethod; // Preferred payment method for auto-renewal
        uint256 notificationSent;    // Last notification timestamp
    }

    enum PaymentMethod { ETH, USDT }

