    mapping(address => uint256) public ethBalances;

    mapping(uint256 => Plan) public plans;
    mapping(address => mapping(uint256 => Subscription)) public subscriptions;

    // Events for notifications and tracking
    event PlanCreated(uint256 indexed planId, string name, uint256 ethPrice, uint256 usdtPrice, uint256 interval);
    event Subscribed(address indexed user, uint256 indexed planId, uint256 expiresAt, PaymentMethod method);
    event Renewed(address indexed user, uint256 indexed planId, uint256 expiresAt, PaymentMethod method, bool autoRenewal);
    event Unsubscribed(address indexed user, uint256 indexed planId);
    event AutoRenewalEnabled(address indexed user, uint256 indexed planId, PaymentMethod method);
    event AutoRenewalDisabled(address indexed user, uint256 indexed planId);
    event AutoRenewalProcessed(address indexed user, uint256 indexed planId, PaymentMethod method);
    event AutoRenewalFailed(address indexed user, uint256 indexed planId, string reason);

    // Notification events
    event ExpirationWarning(address indexed user, uint256 indexed planId, uint256 expiresAt, uint256 daysLeft);
    event SubscriptionExpired(address indexed user, uint256 indexed planId, uint256 expiredAt);
    event RenewalNeeded(address indexed user, uint256 indexed planId, uint256 deadline);

    // Balance events
    event ETHDeposited(address indexed user, uint256 amount);
    event ETHWithdrawn(address indexed user, uint256 amount);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not owner");
        _;
    }

    modifier validPlan(uint256 planId) {
        require(planId < planCounter, "Invalid plan");
        require(plans[planId].active, "Plan inactive");
