    function createPlan(
        string calldata name,
        uint256 ethPrice,
        uint256 usdtPrice,
        uint256 intervalDays
    ) external onlyOwner {
        require(bytes(name).length > 0, "Name required");
        require(ethPrice > 0, "ETH price must be > 0");
        require(usdtPrice > 0, "USDT price must be > 0");
        require(intervalDays > 0, "Invalid interval");

        uint256 intervalSeconds = intervalDays * 1 days;

        plans[planCounter] = Plan({
            name: name,
            ethPrice: ethPrice,
            usdtPrice: usdtPrice,
            interval: intervalSeconds,
            active: true
        });

        emit PlanCreated(planCounter, name, ethPrice, usdtPrice, intervalSeconds);
        planCounter++;
    }

    /**
     * @dev Subscribe to a plan with ETH
     */
    function subscribeWithETH(uint256 planId) external payable validPlan(planId) {
        Plan memory plan = plans[planId];
        require(msg.value == plan.ethPrice, "Incorrect ETH amount");
        require(!isActive(msg.sender, planId), "Already subscribed");

        _processSubscription(planId, plan, PaymentMethod.ETH);
    }

