     * @dev Execute auto-renewal payment (external for try-catch)
     */
    function executeAutoRenewal(address user, uint256 planId, Plan memory plan, PaymentMethod method) external {
        require(msg.sender == address(this), "Internal only");

        if (method == PaymentMethod.ETH) {
            require(ethBalances[user] >= plan.ethPrice, "Insufficient ETH balance");
            ethBalances[user] -= plan.ethPrice;
        } else {
            require(usdtToken.transferFrom(user, address(this), plan.usdtPrice), "USDT transfer failed");
        }

        _processRenewalForUser(user, planId, plan, method, true);
    }

    // ============ PREPAID BALANCE FUNCTIONS ============

    /**
     * @dev Deposit ETH for auto-renewal
     */
    function depositETH() external payable {
        require(msg.value > 0, "Amount must be > 0");
        ethBalances[msg.sender] += msg.value;
        emit ETHDeposited(msg.sender, msg.value);
    }

    /**
     * @dev Withdraw ETH balance
     */
    function withdrawETHBalance(uint256 amount) external {
        require(ethBalances[msg.sender] >= amount, "Insufficient balance");
        require(amount > 0, "Amount must be > 0");

        ethBalances[msg.sender] -= amount;
        (bool success, ) = payable(msg.sender).call{value: amount}("");
        require(success, "ETH withdrawal failed");

        emit ETHWithdrawn(msg.sender, amount);
    }

    // ============ NOTIFICATION FUNCTIONS ============

    /**
     * @dev Check and emit expiration warnings (can be called by keepers)
     */
    function checkExpirationWarnings(address[] calldata users, uint256[] calldata planIds) external {
        require(users.length == planIds.length, "Array length mismatch");

        for (uint256 i = 0; i < users.length; i++) {
            _checkAndNotify(users[i], planIds[i]);
        }
    }

    /**
     * @dev Check single subscription for notifications
     */
    function checkSubscriptionStatus(address user, uint256 planId) external {
        _checkAndNotify(user, planId);
    }

    /**
     * @dev Get users who need renewal soon (helper for keepers)
     */
    function getUsersNeedingRenewal(address[] calldata users, uint256[] calldata planIds) 
        external view returns (address[] memory, uint256[] memory) 
    {
        address[] memory renewalUsers = new address[](users.length);
        uint256[] memory renewalPlans = new uint256[](users.length);
        uint256 count = 0;

        for (uint256 i = 0; i < users.length; i++) {
            Subscription memory sub = subscriptions[users[i]][planIds[i]];
            if (sub.expiresAt > 0 && 
                block.timestamp >= sub.expiresAt - notificationWindow &&
                block.timestamp < sub.expiresAt) {
                renewalUsers[count] = users[i];
                renewalPlans[count] = planIds[i];
                count++;
            }
        }

        // Resize arrays
        address[] memory finalUsers = new address[](count);
        uint256[] memory finalPlans = new uint256[](count);
        for (uint256 i = 0; i < count; i++) {
            finalUsers[i] = renewalUsers[i];
            finalPlans[i] = renewalPlans[i];
        }

        return (finalUsers, finalPlans);
    }

    // ============ INTERNAL FUNCTIONS ============

    /**
     * @dev Internal function to process new subscriptions
     */
    function _processSubscription(uint256 planId, Plan memory plan, PaymentMethod method) internal {
        uint256 expiresAt = block.timestamp + plan.interval;

        if (method == PaymentMethod.ETH) {
            subscriptions[msg.sender][planId] = Subscription({
                expiresAt: expiresAt,
                totalPaidETH: plan.ethPrice,
                totalPaidUSDT: 0,
                autoRenewEnabled: false,
                preferredMethod: PaymentMethod.ETH,
                notificationSent: 0
            });
        } else {
            subscriptions[msg.sender][planId] = Subscription({
                expiresAt: expiresAt,
                totalPaidETH: 0,
                totalPaidUSDT: plan.usdtPrice,
                autoRenewEnabled: false,
                preferredMethod: PaymentMethod.USDT,
                notificationSent: 0
            });
        }

        emit Subscribed(msg.sender, planId, expiresAt, method);
    }

    /**
     * @dev Internal function to process subscription renewals
     */
    function _processRenewal(uint256 planId, Plan memory plan, PaymentMethod method, bool isAutoRenewal) internal {
        _processRenewalForUser(msg.sender, planId, plan, method, isAutoRenewal);
    }

    /**
     * @dev Internal function to process renewal for any user
     */
    function _processRenewalForUser(address user, uint256 planId, Plan memory plan, PaymentMethod method, bool isAutoRenewal) internal {
        Subscription storage sub = subscriptions[user][planId];

        // Extend from current expiry or now, whichever is later
        uint256 newExpiresAt = (sub.expiresAt > block.timestamp) 
            ? sub.expiresAt + plan.interval 
            : block.timestamp + plan.interval;

        sub.expiresAt = newExpiresAt;
        sub.notificationSent = 0; // Reset notification tracker

        if (method == PaymentMethod.ETH) {
            sub.totalPaidETH += plan.ethPrice;
        } else {
            sub.totalPaidUSDT += plan.usdtPrice;
        }

        emit Renewed(user, planId, newExpiresAt, method, isAutoRenewal);
    }

    /**
     * @dev Check and emit notifications for a subscription
     */
    function _checkAndNotify(address user, uint256 planId) internal {
        Subscription storage sub = subscriptions[user][planId];
        if (sub.expiresAt == 0) return; // Not subscribed

        uint256 timeLeft = sub.expiresAt > block.timestamp ? sub.expiresAt - block.timestamp : 0;

        if (timeLeft == 0 && sub.expiresAt > sub.notificationSent) {
            // Subscription expired
            emit SubscriptionExpired(user, planId, sub.expiresAt);
            sub.notificationSent = block.timestamp;
        } else if (timeLeft <= notificationWindow && timeLeft > 0 && sub.notificationSent < sub.expiresAt - notificationWindow) {
            // Expiration warning
            uint256 daysLeft = timeLeft / 1 days;
            emit ExpirationWarning(user, planId, sub.expiresAt, daysLeft);
            emit RenewalNeeded(user, planId, sub.expiresAt);
            sub.notificationSent = block.timestamp;
        }
    }

    // ============ VIEW FUNCTIONS ============

    /**
     * @dev Unsubscribe from a plan
     */
    function unsubscribe(uint256 planId) external {
        require(subscriptions[msg.sender][planId].expiresAt > 0, "Not subscribed");

        delete subscriptions[msg.sender][planId];
        emit Unsubscribed(msg.sender, planId);
    }

    /**
     * @dev Check if user has active subscription
     */
    function isActive(address user, uint256 planId) public view returns (bool) {
        return block.timestamp < subscriptions[user][planId].expiresAt;
    }

    /**
     * @dev Get subscription details
     */
    function getSubscription(address user, uint256 planId) 
        external view returns (
            uint256 expiresAt, 
            uint256 totalPaidETH, 
            uint256 totalPaidUSDT, 
            bool active,
            bool autoRenewEnabled,
            PaymentMethod preferredMethod
        ) 
    {
        Subscription memory sub = subscriptions[user][planId];
        return (
            sub.expiresAt, 
            sub.totalPaidETH, 
            sub.totalPaidUSDT, 
            isActive(user, planId),
            sub.autoRenewEnabled,
            sub.preferredMethod
        );
    }

    /**
     * @dev Get plan details
     */
    function getPlan(uint256 planId) external view returns (Plan memory) {
        require(planId < planCounter, "Invalid plan");
        return plans[planId];
    }

    /**
     * @dev Toggle plan active status (only owner)
     */
    function togglePlan(uint256 planId) external onlyOwner {
        require(planId < planCounter, "Invalid plan");
        plans[planId].active = !plans[planId].active;
    }

    /**
     * @dev Set notification window (only owner)
     */
    function setNotificationWindow(uint256 _notificationWindow) external onlyOwner {
        require(_notificationWindow > 0, "Invalid window");
        notificationWindow = _notificationWindow;
    }

    /**
     * @dev Withdraw ETH balance (only owner)
     */
    function withdrawETH() external onlyOwner {
        uint256 balance = address(this).balance;
        // Don't withdraw user prepaid balances
        uint256 totalUserBalances = 0;
        // Note: In production, you'd track this more efficiently

        require(balance > totalUserBalances, "No revenue to withdraw");

        uint256 withdrawAmount = balance - totalUserBalances;
        (bool success, ) = payable(owner).call{value: withdrawAmount}("");
        require(success, "ETH withdrawal failed");
    }

    /**
     * @dev Withdraw USDT balance (only owner)
     */
    function withdrawUSDT() external onlyOwner {
        uint256 balance = usdtToken.balanceOf(address(this));
        require(balance > 0, "No USDT to withdraw");
        require(usdtToken.transfer(owner, balance), "USDT withdrawal failed");
    }

    /**
     * @dev Get ETH balance
     */
    function getETHBalance() external view returns (uint256) {
        return address(this).balance;
    }

    /**
     * @dev Get USDT balance
     */
    function getUSDTBalance() external view returns (uint256) {
        return usdtToken.balanceOf(address(this));
    }

    /**
     * @dev Update USDT token contract (only owner)
     */
    function updateUSDTToken(address newUSDTToken) external onlyOwner {
        require(newUSDTToken != address(0), "Invalid token address");
        usdtToken = IERC20(newUSDTToken);
    }

    /**
     * @dev Get all active plans (helper function for frontend)
     */
    function getActivePlans() external view returns (uint256[] memory) {
        uint256[] memory tempPlans = new uint256[](planCounter);
        uint256 activeCount = 0;

        for (uint256 i = 0; i < planCounter; i++) {
            if (plans[i].active) {
                tempPlans[activeCount] = i;
                activeCount++;
            }
        }

        // Create properly sized array
        uint256[] memory activePlans = new uint256[](activeCount);
        for (uint256 i = 0; i < activeCount; i++) {
            activePlans[i] = tempPlans[i];
        }

        return activePlans;
    }

    /**
     * @dev Find plan ID by name (returns type(uint256).max if not found)
     */
    function findPlanByName(string calldata name) external view returns (uint256) {
        for (uint256 i = 0; i < planCounter; i++) {
            if (plans[i].active && keccak256(bytes(plans[i].name)) == keccak256(bytes(name))) {
                return i;
            }
        }
        return type(uint256).max; // Not found
    }
}

