// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title MockUSDT
 * @dev Mock USDT token for Lisk Sepolia testnet with faucet functionality
 */
contract MockUSDT is ERC20, Ownable {
    uint8 private _decimals;

    // Faucet settings
    uint256 public faucetAmount = 50; // 50 USDT per faucet call
    uint256 public maxBalance = 100; // Max 100 USDT per address from faucet

    event FaucetUsed(address indexed user, uint256 amount);

    constructor(
        string memory name,
        string memory symbol,
        uint8 decimals_
    ) ERC20(name, symbol) {
        _decimals = decimals_;
        // Mint initial supply to deployer for testing
        _mint(msg.sender, 1000000 * 10**decimals_); // 1M USDT
    }

    function decimals() public view virtual override returns (uint8) {
        return _decimals;
    }

    /**
     * @dev Mint tokens (only owner)
     */
    function mint(address to, uint256 amount) public onlyOwner {
        _mint(to, amount);
    }

    /**
     * @dev Burn tokens
     */
    function burn(uint256 amount) public {
        _burn(msg.sender, amount);
    }

    /**
     * @dev Faucet function - anyone can get test USDT
     * Prevents abuse by limiting amount per address
     */
    function faucet() public {
        uint256 currentBalance = balanceOf(msg.sender);
        require(
            currentBalance < maxBalance * 10**_decimals,
            "You already have enough test USDT"
        );

        uint256 amount = faucetAmount * 10**_decimals;
        _mint(msg.sender, amount);
        emit FaucetUsed(msg.sender, amount);
    }

    /**
     * @dev Update faucet settings (only owner)
     */
    function updateFaucetSettings(uint256 _faucetAmount, uint256 _maxBalance) public onlyOwner {
        faucetAmount = _faucetAmount;
        maxBalance = _maxBalance;
    }

    /**
     * @dev Get remaining faucet amount for an address
     */
    function getRemainingFaucetAmount(address user) public view returns (uint256) {
        uint256 currentBalance = balanceOf(user);
        uint256 maxAllowed = maxBalance * 10**_decimals;

        if (currentBalance >= maxAllowed) {
            return 0;
        }

        return maxAllowed - currentBalance;
    }

    /**
     * @dev Check if address can use faucet
     */
    function canUseFaucet(address user) public view returns (bool) {
        return balanceOf(user) < maxBalance * 10**_decimals;
    }
}

